Create Database sqr_factor;

Use sqr_factor;

Create Table mstr_college_list (
colCode     varchar(20)  NOT NULL,
colName     varchar(500) NOT NULL,
PRIMARY KEY (colCode)
);  



Create table mstr_user_type(
userTypeId      varchar(20)  NOT NULL,
userType        varchar(20)  NOT NULL,
PRIMARY KEY (userTypeId)
);


Create table user_details(
userId       int(16) AUTO_INCREMENT  NOT NULL,
firstName    varchar(100)  ,
lastName     varchar(100),
gender		 varchar(10),
contactNo    varchar(20),
emailId      varchar(100) UNIQUE NOT NULL,
dateOfBirth  varchar(100) ,
usrCountry	 varchar(200),
usrState	 varchar(200),
usrCity		 varchar(200),
userTypeId   varchar(20)  ,
isVerified   tinyint(1) DEFAULT 0,
about		 varchar(200),
profilePicPath	 varchar(500),	
PRIMARY KEY (userId),
FOREIGN KEY (userTypeId) REFERENCES mstr_user_type(userTypeId)
); 

Create table verification_details(
verificationId		int(16) AUTO_INCREMENT NOT NULL,
verificationUserId	int(16) NOT NULL,
emailCode		varchar(100),
phoneCode		varchar(100),
PRIMARY KEY (verificationId),
FOREIGN KEY (verificationUserId) REFERENCES user_details(userId)
);


/**-------------------Education Tables Start-------------------**/

Create table education_details(
id       int(16) AUTO_INCREMENT  NOT NULL,
userId       int(16) NOT NULL,
educationRegNo varchar(100),
educationName varchar(100) NOT NULL,
educationFromDate varchar(100) NOT NULL,
educationToDate varchar(100) NOT NULL,
colCode varchar(20) NOT NULL,
PRIMARY KEY (id),
FOREIGN KEY (userId) REFERENCES user_details(userId),
FOREIGN KEY (colCode) REFERENCES mstr_college_list(colCode)
);

/**-------------------Education Tables End-------------------**/

/**-------------------Professional Tables Start-------------------**/

Create table profession_details(
id       int(16) AUTO_INCREMENT NOT NULL,
userId       int(16) NOT NULL,
professionType	varchar(20) NOT NULL,
professionRole	varchar(100) NOT NULL,
professionCompany varchar(100) NOT NULL,
professionSalary varchar(100),
professionFromDate varchar(100) NOT NULL,
professionToDate varchar(100),
professionToDateIsCurrent tinyint(1) DEFAULT 0,
PRIMARY KEY (id),
FOREIGN KEY (userId) REFERENCES user_details(userId)
);


Create table additional_profession_details(
id		int(16) AUTO_INCREMENT NOT NULL,
userId  int(16) NOT NULL,
coaNumber 	varchar(100),
iiaNumber 	varchar(100),
PRIMARY KEY (id),
FOREIGN KEY (userId) REFERENCES user_details(userId)
);

/**-------------------Professional Tables End-------------------**/


Create table user_login(
userId       int(16),
userName     varchar(100) NOT NULL,
userPassword varchar(100) NOT NULL,
PRIMARY KEY (userId),
FOREIGN KEY (userId) REFERENCES user_details(userId)
);

Create table social_login(
userId       int(16),
socialUID VARCHAR(100),
loginVia VARCHAR(20),
FOREIGN KEY (userId) REFERENCES user_details(userId)
);

/**-------------------Feed Tables Start-------------------**/
Create Table feed_action_list (
feedActionId   int(3) AUTO_INCREMENT NOT NULL,
feedAction     varchar(100) NOT NULL,
PRIMARY KEY (feedActionId)
);


Create Table feed_type_list (
feedTypeId   int(3) AUTO_INCREMENT NOT NULL,
feedType     varchar(100) NOT NULL,
PRIMARY KEY (feedTypeId)
);


Create table feed_details(
feedId       int(16) AUTO_INCREMENT NOT NULL,
userId       int(16), 
feedTypeId     int(3),
feedText	varchar(1000),
feedPath	varchar(500),
feedActionId	int(3),
feedRefId 		int(16),
placeName 		VARCHAR(250),
placeAddress 	VARCHAR(250),
placeLat 		DECIMAL(10,8),
placeLng 		DECIMAL(11,8),
createdAt		TIMESTAMP,
modifiedAt		TIMESTAMP,
PRIMARY KEY (feedId),
FOREIGN KEY (userId) REFERENCES user_details(userId),
FOREIGN KEY (feedTypeId) REFERENCES feed_type_list(feedTypeId)
);

/**-------------------Feed Tables End-------------------**/

/**-------------------Connection Tables Start-------------------**/

Create table connection_details(
connectionId       int(16) AUTO_INCREMENT NOT NULL,
sourceId       	   int(16), 
destinationId      int(16), 
PRIMARY KEY (connectionId),
FOREIGN KEY (sourceId) REFERENCES user_details(userId),
FOREIGN KEY (destinationId) REFERENCES user_details(userId)
);

/**-------------------Connection Tables End-------------------**/

/**-------------------Notification Tables Start-------------------**/


Create Table notification_type_list (
typeId     int(20)  NOT NULL,
typeName     varchar(500) NOT NULL,
PRIMARY KEY (typeId)
);  


Create table notification_details(
notificationId     int(16) AUTO_INCREMENT NOT NULL,
sourceUserId       	   int(16), 
destinationUserId      int(16),
notificationTypeId		int(10),
feedRefId				int(16),
isRead					tinyint(1) DEFAULT 0,
createdAt				TIMESTAMP,
PRIMARY KEY (notificationId),
FOREIGN KEY (notificationTypeId) REFERENCES notification_type_list(typeId),
FOREIGN KEY (sourceUserId) REFERENCES user_details(userId),
FOREIGN KEY (destinationUserId) REFERENCES user_details(userId)
);

/**-------------------Notification Tables End-------------------**/
/**-------------------Message Tables Start-------------------**/

Create table message_details(
messageId              int(16) AUTO_INCREMENT NOT NULL,
senderUserId       	   int(16) NOT NULL, 
recipientUserId        int(16) NOT NULL,
messageText					varchar(100) NOT NULL,
isRead				   tinyint(1) DEFAULT 0,
createdAt			   TIMESTAMP,
PRIMARY KEY (messageId),
FOREIGN KEY (senderUserId) REFERENCES user_details(userId),
FOREIGN KEY (recipientUserId) REFERENCES user_details(userId)
);

/**-------------------Message Tables End-------------------**/
/**-------------------Achievement Tables Start-------------------**/

Create table achievement_details(
achievementId           int(16) AUTO_INCREMENT NOT NULL,
achievementName			varchar(100) NOT NULL,
achievementDescription	varchar(100) NOT NULL,
createdAt			   TIMESTAMP,
PRIMARY KEY (achievementId)
);

Create table achievement_earned(
achievementEarnedId		int(16) AUTO_INCREMENT NOT NULL,
userId       	   		int(16) NOT NULL, 
achievementId        	int(16) NOT NULL,
createdAt			   	TIMESTAMP,
PRIMARY KEY (achievementEarnedId),
FOREIGN KEY (userId) REFERENCES user_details(userId),
FOREIGN KEY (achievementId) REFERENCES achievement_details(achievementId)
);

/**-------------------Achievement Tables End-------------------**/

/**-------------------Invitation Tables Start-------------------**/

Create table invitation_details(
invitationId		int(16) AUTO_INCREMENT NOT NULL,
invitedByUserId     int(16) NOT NULL, 
invitedToUserId     int(16) NOT NULL,
PRIMARY KEY (invitationId),
FOREIGN KEY (invitedByUserId) REFERENCES user_details(userId),
FOREIGN KEY (invitedByUserId) REFERENCES user_details(userId)
);

/**-------------------Invitation Tables End-------------------**/

/**-------------------Competition Tables Start--------------**/

Create table competition_details(
compId       int(16) AUTO_INCREMENT NOT NULL,
userId       int(16) NOT NULL,
compType     varchar(10) NOT NULL,
compTitle    varchar(200) NOT NULL,
compHeading  varchar(300) ,
compBrief    varchar(500) ,
compECriteria     varchar(50),
compECriteriaOthers     varchar(300),
coverPic     varchar(500),
profilePic   varchar(500),
compSubRqrmts varchar(1000),
compFAQ       varchar(1000),
compStartDate varchar(100),
compEndDate varchar(100),
compSubEndDate varchar(100),
compResultDate varchar(100),
compDetails varchar(300),
compBriefPath varchar(500),
compFees	varchar(10),
compCurrency	varchar(10),
createdAt		TIMESTAMP,
PRIMARY KEY (compId),
FOREIGN KEY (userId) REFERENCES user_details(userId)
); 

Create table competition_jury(
compJuryId int(16) AUTO_INCREMENT NOT NULL,
compId       int(16) NOT NULL,
juryName     varchar(100),
juryFirmName varchar(200),
juryEmail    varchar(100),
juryContactNo varchar(20),
juryPic      varchar(500),
juryDetails  varchar(300),
PRIMARY KEY (compJuryId),
FOREIGN KEY (compId) REFERENCES competition_details(compId)
);

Create table competition_awards(
compAwardId int(16) AUTO_INCREMENT NOT NULL,
compId       int(16) NOT NULL,
awardType      varchar(100),
awardPrice     varchar(100),
awardDetails     varchar(100),
PRIMARY KEY (compAwardId),
FOREIGN KEY (compId) REFERENCES competition_details(compId)
);

Create table competition_partners(
compPartnerId int(16) AUTO_INCREMENT NOT NULL,
compId       int(16) NOT NULL,
partnerName     varchar(100),
partnerWebsite     varchar(100),
partnerEmail    varchar(100),
partnerContactNo varchar(20),
partnerPic      varchar(500),
partnerDetails  varchar(300),
PRIMARY KEY (compPartnerId),
FOREIGN KEY (compId) REFERENCES competition_details(compId)
);

Create table competition_registration(
compRegistrationId int(16) AUTO_INCREMENT NOT NULL,
compId       		int(16) NOT NULL,
userId       		int(16) NOT NULL,
compTeamCode		varchar(100) NOT NULL,
compUserRole		varchar(20) NOT NULL,
PRIMARY KEY (compRegistrationId),
FOREIGN KEY (compId) REFERENCES competition_details(compId),
FOREIGN KEY (userId) REFERENCES user_details(userId)
);

Create table competition_submission(
compSubmissionId int(16) AUTO_INCREMENT NOT NULL,
compId       		int(16) NOT NULL,
compTeamCode		varchar(100) NOT NULL,
filePath			varchar(500),
submittedByUserId	int(16) NOT NULL,
createdAt			TIMESTAMP,
PRIMARY KEY (compSubmissionId),
FOREIGN KEY (compId) REFERENCES competition_details(compId),
FOREIGN KEY (submittedByUserId) REFERENCES user_details(userId)
);

Create table competition_result(
compResultId int(16) AUTO_INCREMENT NOT NULL,
compId       		int(16) NOT NULL,
compTeamCode		varchar(100) NOT NULL,
compAwardId			int(16) NOT NULL,
submittedByUserId	int(16) NOT NULL,
createdAt			TIMESTAMP,
PRIMARY KEY (compResultId),
FOREIGN KEY (compId) REFERENCES competition_details(compId),
FOREIGN KEY (compAwardId) REFERENCES competition_awards(compAwardId),
FOREIGN KEY (submittedByUserId) REFERENCES user_details(userId)
);

Create table event_feed(
eventFeedId int(16) AUTO_INCREMENT NOT NULL,
userId       		int(16) NOT NULL,
eventType			varchar(20) NOT NULL,
eventTypeId			int(16) NOT NULL,
eventActionId		int(3),
eventText			varchar(500),
eventRefId 			int(16),
createdAt			TIMESTAMP,
modifiedAt			TIMESTAMP,
PRIMARY KEY (eventFeedId),
FOREIGN KEY (userId) REFERENCES user_details(userId)
);

/**-------------------Competition Tables End--------------**/

